import React,{ Component } from 'react'
import { UserConsumerHooks } from "./ContextHooks";


const CompnentFiveHooks= () => {

    return (
       
        <UserConsumerHooks>
        {
            (value)=>{
                return(
                    <div>                    
                        <h1>Welcome From Component Five-----------{value}</h1>
                    </div>
                )
            }
            }
        </UserConsumerHooks>
 
    )
  }

  export default CompnentFiveHooks;
